import React, { useState } from "react";
import { Container, List, Logo, Hamburger } from "./NavbarStyles";
import { FaRegUser, FaHeartbeat } from "react-icons/fa";
import { ImManWoman } from "react-icons/im";
import { GiMusicalNotes } from "react-icons/gi";
import { Link } from "react-router-dom";
import c1 from "../../components/Img/ieq2.jpg";

export default function Navbar() {
  const [open, setOpen] = useState(false);

  const handleClick = () => setOpen(false);

  return (
    <Container>
      {/* Logo sempre vis√≠vel */}
      <Logo>
        <a
          href="https://maps.app.goo.gl/e9p6hr2WNqNPU19V9"
          target="_blank"
          rel="noopener noreferrer"
        >
          <img src={c1} alt="logo" />
        </a>
      </Logo>

      {/* Hamburger menu */}
      <Hamburger onClick={() => setOpen(!open)}>
        <span></span>
        <span></span>
        <span></span>
      </Hamburger>

      {/* Links */}
      <List open={open}>
        <li>
          <Link to="/home" onClick={handleClick}>
            <FaHeartbeat />
          </Link>
        </li>
        <li>
          <Link to="/sobrenos" onClick={handleClick}>
            <ImManWoman />
          </Link>
        </li>
        <li>
          <Link to="/app" onClick={handleClick}>
            <GiMusicalNotes />
          </Link>
        </li>
        <li>
          <Link to="/" onClick={handleClick}>
            <FaRegUser />
          </Link>
        </li>
      </List>
    </Container>
  );
}
